sys_variable_value.value:
(function execute(inputs, outputs) {
  /*
  	This action calls the table API to fetch a sn_app_eng_studio_deployment_request record with the given app_sys_id and 			app_version from the given url

    Some error outputs and their scenarios are as follows:
    1. Invalid prod_cred_sys_id: has_error: true, status_code: 403
    2. Credentials retrieved could not be authenticated: has_error: true, 401
    3. Url could not be hit: has_error: true, status_code: 0,
    4. Url does not have a path '/api/now/table/sn_app_eng_studio_deployment_request' defined on it: has_error: false, status_code: 200, body: html
    5. Url does not have table API or AES: has_error: true, status_code: 400

    NOTE: The url from inputs is no longer being used in this script. See: DEF0187977
    We will use the PipelineService to retrieve the prod url instead
  */

  var provider = new sn_cc.StandardCredentialsProvider();
  var credential = provider.getCredentialByID(inputs.prod_cred_sys_id);

  if (!credential) {
    outputs['has_error'] = true;
  	outputs['error_message'] = gs.getMessage('Invalid/incomplete credentials for GET Deployment Request flow action');
  	outputs['status_code'] = 403;
    return;
  }

  var prodUrl = '';

  try {
  	var pipelineService = new PipelineService();
  	prodUrl = pipelineService.getEnvironmentUrl(PipelineConstants.PROD_ENV_COLUMN);
  } catch(error) {
    outputs['has_error'] = true;
    outputs['error_message'] = error.name;
    outputs['status_code'] = error.code;
    return;
  }

  var deploymentRequest = new sn_ws.RESTMessageV2();
  deploymentRequest.setEndpoint(prodUrl + 'api/now/table/sn_app_eng_studio_deployment_request');
  deploymentRequest.setHttpMethod('GET');
  deploymentRequest.setBasicAuth(credential.getAttribute("user_name"), credential.getAttribute("password"));
  deploymentRequest.setQueryParameter("app_sys_id", inputs.application_sys_id);
  deploymentRequest.setQueryParameter("app_version", inputs.application_version);
  deploymentRequest.setRequestHeader("Accept","application/json");

  var deploymentRequestResponse = deploymentRequest.execute();

  outputs['body'] = deploymentRequestResponse.getBody();
  outputs['has_error'] = deploymentRequestResponse.haveError();
  outputs['error_message'] = deploymentRequestResponse.getErrorMessage();
  outputs['status_code'] = deploymentRequestResponse.getStatusCode();

})(inputs, outputs);

